  false,\n\t\"url\": null,\n\t\"notes\": \"This part of SIM 3254 presents data for
  the bathymetry and shaded-relief maps (see sheets 1, 2, SIM 3254) of the Offshore
  of Ventura map area, California. The raster data file for the bathymetry map is
  included in \"Bathymetry_OffshoreVentura.zip.\" The raster data file for the shaded-relief
  map is included in \"BathymetryHS_OffshoreVentura.zip.\" Both are accessible from
  http://pubs.usgs.gov/ds/781/OffshoreVentura/data_catalog_OffshoreVentura.html. The
  bathymetry and shaded-relief maps of the Offshore of Ventura map area, California,
  were generated from bathymetry data collected by California State University, Monterey
  Bay, Seafloor Mapping Lab (CSUMB) and by the U.S. Geological Survey (USGS). Most
  of the offshore area was mapped by CSUMB in the summers of 2006 and 2007, using
  a 244-kHz Reson 8101 multibeam echosounder. The seafloor west of Ventura Harbor
  was mapped by the USGS in 2006 and 2010, using 117-kHz (2006) and 234.5-kHz (2010)
  SEA (AP) Ltd. SWATHplus-M phase-differencing sidescan sonars. These mapping missions
  combined to collect bathymetry from about the 10-m isobath to beyond the 3-nautical-mile
  limit of California's State Waters.\",\n\t\"owner_org\": \"bd2cdd5a-4d65-46c0-9937-c8381175f104\",\n\t\"extras\":
